import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
// import logo from "./media/logo.jpg";
class NavBar extends Component {
  state = {
    img:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fdlpng.com%2Fpng%2F213437&psig=AOvVaw3BvVdE8GeHXBgSQ5ZDb3O2&ust=1586373120074000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKjDiMiC1-gCFQAAAAAdAAAAABAD",
  };
  render() {
    return (
      <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
        <ul className="navbar-nav">
          <li className="nav-item active">
            <a class="navbar-brand" href="#">
              <img src={logo} alt="Logo" style="width:40px;"></img>
            </a>
          </li>
          <li className="nav-item active">
            <a className="nav-link" href="#">
              Active
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">
              Link
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">
              Link
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link disabled" href="#">
              Disabled
            </a>
          </li>
        </ul>
      </nav>
    );
  }
}

export default NavBar;

